import React, { useState } from "react";
import api from "../../services/api";
import './Products.css';

const Products = (props) => {

  const [isLoading, setLoading] = useState(false);
  const [isError, setError] = useState("");
  const [isListProducts, setListProducts] = useState([]);

  const getListProducts = () => {
    setLoading(true);
    api.getProducts(props.props).then(
      (resp) => {
        setListProducts(resp.data);
        setLoading(false);
      },
      (err) => {
        setLoading(false);
        setError("ERROR. Favor de comunicarse con sistemas.");
      }
    );
  };

  return (
    <div className="contenedor-tabla">
        <table className="table">
        <thead>
            <tr>
            <th scope="col">#</th>
            <th scope="col">First</th>
            <th scope="col">Last</th>
            <th scope="col">Handle</th>
            </tr>
        </thead>
        <tbody>
            <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
            </tr>
            <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
            </tr>
            <tr>
            <th scope="row">3</th>
            <td>Larry</td>
            <td>the Bird</td>
            <td>@twitter</td>
            </tr>
        </tbody>
        </table>
    </div>
  );
};

export default Products;
